Objects, as with backgrounds, are composed of 8x8 tiles, and if you want something bigger than 8x8 you have to use more than one tile put together. Object tiles go into the final two charblocks of VRAM (indexes 4 and 5). Because there's only two of them, they are sometimes called the lower block ( 0x601_0000 ) and the higher/upper block ( 0x601_4000 ). Tile indexes for sprites always offset from the base of the lower block, and they always go 32 bytes at a time, regardless of if the object is set for 4bpp or 8bpp. From this we can determine that there's 512 tile slots in each of the two object charblocks. However, in video modes 3, 4, and 5 the space for the background cuts into the lower charblock, so you can only safely use the upper charblock. pub fn obj_tile_4bpp(tile_index: usize) -> Tile4bpp { assert!(tile_index < 512); let address = VRAM + size_of::<Charblock4bpp>() * 4 + 32 * tile_index; unsafe { VolatilePtr(address as *mut Tile4bpp).read() }
} pub fn set_obj_tile_4bpp(tile_index: usize, tile: Tile4bpp) { assert!(tile_index < 512); let address = VRAM + size_of::<Charblock4bpp>() * 4 + 32 * tile_index; unsafe { VolatilePtr(address as *mut Tile4bpp).write(tile) }
} pub fn obj_tile_8bpp(tile_index: usize) -> Tile8bpp { assert!(tile_index < 512); let address = VRAM + size_of::<Charblock8bpp>() * 4 + 32 * tile_index; unsafe { VolatilePtr(address as *mut Tile8bpp).read() }
} pub fn set_obj_tile_8bpp(tile_index: usize, tile: Tile8bpp) { assert!(tile_index < 512); let address = VRAM + size_of::<Charblock8bpp>() * 4 + 32 * tile_index; unsafe { VolatilePtr(address as *mut Tile8bpp).write(tile) }
} With backgrounds you picked every single tile individually with a bunch of screen entry values. Objects don't do that at all. Instead you pick a base tile, size, and shape, then it figures out the rest from there. However, you may recall back with the display control register something about an "object memory 1d" bit. This is where that comes into play. If object memory is set to be 2d (the default) then each charblock is treated as 32 tiles by 32 tiles square. Each object has a base tile and dimensions, and that just extracts directly from the charblock picture as if you were selecting an area. This mode probably makes for the easiest image editing. If object memory is set to be 1d then the tiles are loaded sequentially from the starting point, enough to fill in the object's dimensions. This most probably makes it the easiest to program with about things, since programming languages are pretty good at 1d things. I'm not sure I explained that well, here's a picture: 2d1d-diagram In 2d mode, a new row of tiles starts every 32 tile indexes. Of course, the mode that you actually end up using is not particularly important, since it should be the job of your image conversion routine to get everything all lined up and into place anyway.

