Oh I bet you thought we could somehow get through a section without learning about yet another IO register. Ha, wishful thinking. There's actually not much involved. Starting at 0x400_0100 there's an array of registers that go "data", "control", "data", "control", etc. TONC and GBATEK use different names here, and we'll go by the TONC names because they're much clearer: pub const TM0D: VolatilePtr<u16> = VolatilePtr(0x400_0100 as *mut u16);
pub const TM0CNT: VolatilePtr<u16> = VolatilePtr(0x400_0102 as *mut u16); pub const TM1D: VolatilePtr<u16> = VolatilePtr(0x400_0104 as *mut u16);
pub const TM1CNT: VolatilePtr<u16> = VolatilePtr(0x400_0106 as *mut u16); pub const TM2D: VolatilePtr<u16> = VolatilePtr(0x400_0108 as *mut u16);
pub const TM2CNT: VolatilePtr<u16> = VolatilePtr(0x400_010A as *mut u16); pub const TM3D: VolatilePtr<u16> = VolatilePtr(0x400_010C as *mut u16);
pub const TM3CNT: VolatilePtr<u16> = VolatilePtr(0x400_010E as *mut u16); Basically there's 4 timers, numbered 0 to 3. Each one has a Data register and a Control register. They're all u16 and you can definitely read from all of them normally, but then it gets a little weird. You can also write to the Control portions normally, when you write to the Data portion of a timer that writes the value that the timer resets to, without changing its current Data value. So if TM0D is paused on some value other than 5 and you write 5 to it, when you read it back you won't get a 5 . When the next timer run starts it'll begin counting at 5 instead of whatever value it currently reads as. The Data registers are just a u16 number, no special bits to know about. The Control registers are also pretty simple compared to most IO registers: 2 bits for the Frequency: 1, 64, 256, 1024. While active, the timer's value will tick up once every frequency CPU cycles. On the GBA, 1 CPU cycle is about 59.59ns (2^(-24) seconds). One display controller cycle is 280,896 CPU cycles. 1 bit for Cascade Mode: If this is on the timer doesn't count on its own, instead it ticks up whenever the preceding timer overflows its counter (eg: if t0 overflows, t1 will tick up if it's in cascade mode). You still have to also enable this timer for it to do that (below). This naturally doesn't have an effect when used with timer 0. 3 bits that do nothing 1 bit for Interrupt: Whenever this timer overflows it will signal an interrupt. We still haven't gotten into interrupts yet (since you have to hand write some ASM for that, it's annoying), but when we cover them this is how you do them with timers. 1 bit to Enable the timer. When you disable a timer it retains the current value, but when you enable it again the value jumps to whatever its currently assigned default value is. #[derive(Debug, Clone, Copy, Default, PartialEq, Eq)]
#[repr(transparent)]
pub struct TimerControl(u16); #[derive(Debug, Clone, Copy, PartialEq, Eq)]
pub enum TimerFrequency { One = 0, SixFour = 1, TwoFiveSix = 2, OneZeroTwoFour = 3,
} impl TimerControl { pub fn frequency(self) -> TimerFrequency { match self.0 & 0b11 { 0 => TimerFrequency::One, 1 => TimerFrequency::SixFour, 2 => TimerFrequency::TwoFiveSix, 3 => TimerFrequency::OneZeroTwoFour, _ => unreachable!(), } } pub fn cascade_mode(self) -> bool { self.0 & 0b100 > 0 } pub fn interrupt(self) -> bool { self.0 & 0b100_0000 > 0 } pub fn enabled(self) -> bool { self.0 & 0b1000_0000 > 0 } // pub fn set_frequency(&mut self, frequency: TimerFrequency) { self.0 &= !0b11; self.0 |= frequency as u16; } pub fn set_cascade_mode(&mut self, bit: bool) { if bit { self.0 |= 0b100; } else { self.0 &= !0b100; } } pub fn set_interrupt(&mut self, bit: bool) { if bit { self.0 |= 0b100_0000; } else { self.0 &= !0b100_0000; } } pub fn set_enabled(&mut self, bit: bool) { if bit { self.0 |= 0b1000_0000; } else { self.0 &= !0b1000_0000; } }
}

