unsafe fn u32_from_user_wait() -> u32 { let mut t = TimerControl::default(); t.set_enabled(true); t.set_cascading(true); TM1CNT.write(t.0); t.set_cascading(false); TM0CNT.write(t.0); while key_input().0 == 0 {} t.set_enabled(false); TM0CNT.write(t.0); TM1CNT.write(t.0); let low = TM0D.read() as u32; let high = TM1D.read() as u32; (high << 32) | low
