The Linear Congruential Generator is a well known PRNG family. You pick a multiplier and an additive and you're done. Right? Well, not exactly, because (as the wikipedia article explains) the values that you pick can easily make your LCG better or worse all on its own. You want a good multiplier, and you want your additive to be odd. In our example here we've got the values that Bulbapedia says were used in the actual GBA Pokemon games, though Bulbapedia also lists values for a few other other games as well. I don't actually know if any of the constants used in the official games are particularly good from a statistical viewpoint, though with only 32 bits an LCG isn't gonna be passing any of the major statistical tests anyway (you need way more bits in your LCG for that to happen). In my mind the main reason to use a plain LCG like this is just for the fun of using the same PRNG that an official Pokemon game did. You should not use this as your default generator if you care about quality. It is very fast though... if you want to set everything else on fire for speed. If you do, please at least remember that the highest bits are the best ones, so if you're after less than 32 bits you should shift the high ones down and keep those, or if you want to turn it into a bool cast to i32 and then check if it's negative, etc. pub fn lcg32(seed: u32) -> u32 { seed.wrapping_mul(0x41C6_4E6D).wrapping_add(0x6073)
} Compiler Explorer Multi-stream Generators Note that you don't have to add a compile time constant, you could add a runtime value instead. Doing so allows the generator to be "multi-stream", with each different additive value being its own unique output stream. This true of LCGs as well as all the PCGs below (since they're LCG based). The examples here just use a fixed stream for simplicity and to save space, but if you want streams you can add that in for only a small amount of extra space used: pub fn lcg_streaming(seed: u32, stream: u32) -> u32 { seed.wrapping_mul(0x41C6_4E6D).wrapping_add(stream)
} With a streaming LCG you should pass the same stream value every single time. If you don't, then your generator will jump between streams in some crazy way and you lose your nice uniformity properties. There is the possibility of intentionally changing the stream value exactly when the seed lands on a pre-determined value (after the multiply and add). This basically makes the stream selection value's bit size (minus one bit, because it must be odd) count into the LCG's state bit size for calculating the overall period of the generator. So an LCG32 with a 32-bit stream selection would have a period of 2^32 * 2^31 = 2^63. let next_seed = lcg_streaming(seed, stream);
// It's cheapest to test for 0, so we pick 0
if seed == 0 { stream = stream.wrapping_add(2)
} However, this isn't a particularly effective way to extend the generator's period, and we'll see a much better extension technique below.

