The Permuted Congruential Generator family is the next step in LCG technology. We start with LCG output, which is good but not great, and then we apply one of several possible permutations to bump up the quality. There's basically a bunch of permutation components that are each defined in terms of the bit width that you're working with. The "default" variant of PCG, PCG32, has 64 bits of state and 32 bits of output, and it uses the "XSH-RR" permutation. Here we'll put together a 32 bit version with 16-bit output, and using the "XSH-RS" permutation (but we'll show the other one too for comparison). Of course, since PCG is based on a LCG, we have to start with a good LCG base. As I said above, a better or worse set of LCG constants can make your generator better or worse. The Wikipedia example for PCG has a good 64-bit constant, but not a 32-bit constant. So we gotta ask an expert about what a good 32-bit constant would be. I'm definitely not the best at reading math papers, but it seems that the general idea is that we want m % 8 == 5 and is_even(a) to both hold for the values we pick. There are three suggested LCG multipliers in a chart on page 10. A chart that's quite hard to understand. Truth be told I asked several folks that are good at math papers and even they couldn't make sense of the chart. Eventually timutable read the whole paper in depth and concluded the same as I did: that we probably want to pick the 32310901 option. For an additive value, we can pick any odd value, so we might as well pick something small so that we can do an immediate add. Immediate add? That sounds new. An immediate instruction is when one side of an operation is small enough that you can encode the value directly into the space that'd normally be for the register you want to use. It basically means one less load you have to do, if you're working with small enough numbers. To see what I mean compare loading the add value and immediate add value . It's something you might have seen frequently in x86 or x86_64 ASM output, but because a thumb instruction is only 16 bits total, we can only get immediate instructions if the target value is 8 bits or less, so we haven't used them too much ourselves yet. I guess we'll pick 5, because I happen to personally like the number. // Demo only. The "default" PCG permutation, for use when rotate is cheaper
pub fn pcg16_xsh_rr(seed: &mut u32) -> u16 { *seed = seed.wrapping_mul(32310901).wrapping_add(5); const INPUT_SIZE: u32 = 32; const OUTPUT_SIZE: u32 = 16; const ROTATE_BITS: u32 = 4; let mut out32 = *seed; let rot = out32 >> (INPUT_SIZE - ROTATE_BITS); out32 ^= out32 >> ((OUTPUT_SIZE + ROTATE_BITS) / 2); ((out32 >> (OUTPUT_SIZE - ROTATE_BITS)) as u16).rotate_right(rot)
} // This has slightly worse statistics but runs much better on the GBA
pub fn pcg16_xsh_rs(seed: &mut u32) -> u16 { *seed = seed.wrapping_mul(32310901).wrapping_add(5); const INPUT_SIZE: u32 = 32; const OUTPUT_SIZE: u32 = 16; const SHIFT_BITS: u32 = 2; const NEXT_MOST_BITS: u32 = 19; let mut out32 = *seed; let shift = out32 >> (INPUT_SIZE - SHIFT_BITS); out32 ^= out32 >> ((OUTPUT_SIZE + SHIFT_BITS) / 2); (out32 >> (NEXT_MOST_BITS + shift)) as u16
} Compiler Explorer

