As a general improvement to any PCG you can hook on an "extension array" to give yourself a longer period. It's all described in the PCG Paper , but here's the bullet points: In addition to your generator's state (and possible stream) you keep an array of "extension" values. The array type is the same as your output type, and the array count must be a power of two value that's less than the maximum value of your state size. When you run the generator, use the lowest bits to select from your extension array according to the array's power of two. Eg: if the size is 2 then use the single lowest bit, if it's 4 then use the lowest 2 bits, etc. Every time you run the generator, XOR the output with the selected value from the array. Every time the generator state lands on 0, cycle the array. We want to be careful with what we mean here by "cycle". We want the entire pattern of possible array bits to occur eventually. However, we obviously can't do arbitrary adds for as many bits as we like, so we'll have to "carry the 1" between the portions of the array by hand. Here's an example using an 8 slot array and pcg16_xsh_rs : // uses pcg16_xsh_rs from above pub struct PCG16Ext8 { state: u32, ext: [u16; 8],
} impl PCG16Ext8 { pub fn next_u16(&mut self) -> u16 { // PCG as normal. let mut out = pcg16_xsh_rs(&mut self.state); // XOR with a selected extension array value out ^= unsafe { self.ext.get_unchecked((self.state & !0b111) as usize) }; // if state == 0 we cycle the array with a series of overflowing adds if self.state == 0 { let mut carry = true; let mut index = 0; while carry && index < self.ext.len() { let (add_output, next_carry) = self.ext[index].overflowing_add(1); self.ext[index] = add_output; carry = next_carry; index += 1; } } out }
} Compiler Explorer The period gained from using an extension array is quite impressive. For a b-bit generator giving r-bit outputs, and k array slots, the period goes from 2^b to 2^(k*r+b). So our 2^32 period generator has been extended to 2^160. Of course, we might care to seed the array itself so that it's not all 0 bits all the way though, but that's not strictly necessary. All 0s is a legitimate part of the extension cycle, so we have to pass through it at some point.

