The Xoshiro128** generator is an advancement of the Xorshift family . It was specifically requested, and I'm not aware of Xorshift specifically being used in any of my favorite games, so instead of going over Xorshift and then leading up to this, we'll just jump straight to this. Take care not to confuse this generator with the very similarly named Xoroshiro128** generator, which is the 64 bit variant. Note the extra "ro" hiding in the 64-bit version's name near the start. Anyway, weird names aside, it's fairly zippy. The biggest downside is that you can't have a seed state that's all 0s, and as a result 0 will be produced one less time than all other outputs within a full cycle, making it non-uniform by just a little bit. You also can't do a simple stream selection like with the LCG based generators, instead it has a fixed jump function that advances a seed as if you'd done 2^64 normal generator advancements. Note that Xoshiro256** is known to fail statistical tests, so the 128 version is unlikely to pass them, though I admit that I didn't check myself. pub fn xoshiro128_starstar(seed: &mut [u32; 4]) -> u32 { let output = seed[0].wrapping_mul(5).rotate_left(7).wrapping_mul(9); let t = seed[1] << 9; seed[2] ^= seed[0]; seed[3] ^= seed[1]; seed[1] ^= seed[2]; seed[0] ^= seed[3]; seed[2] ^= t; seed[3] = seed[3].rotate_left(11); output
} pub fn xoshiro128_starstar_jump(seed: &mut [u32; 4]) { const JUMP: [u32; 4] = [0x8764000b, 0xf542d2d3, 0x6fa035c3, 0x77f2db5b]; let mut s0 = 0; let mut s1 = 0; let mut s2 = 0; let mut s3 = 0; for j in JUMP.iter() { for b in 0 .. 32 { if *j & (1 << b) > 0 { s0 ^= seed[0]; s1 ^= seed[1]; s2 ^= seed[2]; s3 ^= seed[3]; } xoshiro128_starstar(seed); } } seed[0] = s0; seed[1] = s1; seed[2] = s2; seed[3] = s3;
} Compiler Explorer

