This is Bob Jenkins's [Small/Fast PRNG](small noncryptographic PRNG). It's a little faster than Xoshiro128** (no multiplication involved), and can pass any statistical test that's been thrown at it. Interestingly the generator's period is not fixed based on the generator overall. It's actually set by the exact internal generator state. There's even six possible internal generator states where the generator becomes a fixed point. Because of this, we should use the verified seeding method provided. Using the provided seeding, the minimum period is expected to be 2^94, the average is about 2^126, and no seed given to the generator is likely to overlap with another seed's output for at least 2^64 uses. pub struct JSF32 { a: u32, b: u32, c: u32, d: u32,
} impl JSF32 { pub fn new(seed: u32) -> Self { let mut output = JSF32 { a: 0xf1ea5eed, b: seed, c: seed, d: seed }; for _ in 0 .. 20 { output.next(); } output } pub fn next(&mut self) -> u32 { let e = self.a - self.b.rotate_left(27); self.a = self.b ^ self.c.rotate_left(17); self.b = self.c + self.d; self.c = self.d + e; self.d = e + self.a; self.d }
} Compiler Explorer Here it's presented with (27,17), but you can also use any of the following if you want alternative generator flavors that use this same core technique: (9,16), (9,24), (10,16), (10,24), (11,16), (11,24), (25,8), (25,16), (26,8), (26,16), (26,17), or (27,16). Note that these alternate flavors haven't had as much testing as the (27,17) version, though they are likely to be just as good.

