How do we do the actual divmod when we're forced to? Easy: inline assembly of course (There's also an ARM oriented blog post about it that I found most helpful). The GBA has many BIOS Functions , each of which has a designated number. We use the swi op (short for "SoftWare Interrupt") combined with the BIOS function number that we want performed. Our code halts, some setup happens (hence that 60 cycles of overhead I mentioned), the BIOS does its thing, and then eventually control returns to us. The precise details of what the BIOS call does depends on the function number that we call. We'd even have to potentially mark it as volatile asm if there's no clear outputs, otherwise the compiler would "helpfully" eliminate it for us during optimization. In our case there are clear outputs. The numerator goes into register 0, and the denominator goes into register 1, the divmod happens, and then the division output is left in register 0 and the modulus output is left in register 1. I keep calling it "divmod" because div and modulus are two sides of the same coin. There's no way to do one of them faster by not doing the other or anything like that, so we'll first define it as a unified function that returns a tuple: #![feature(asm)]
// put the above at the top of any program and/or library that uses inline asm pub fn div_modulus(numerator: i32, denominator: i32) -> (i32, i32) { assert!(denominator != 0); { let div_out: i32; let mod_out: i32; unsafe { asm!(/* assembly template */ "swi 0x06" :/* output operands */ "={r0}"(div_out), "={r1}"(mod_out) :/* input operands */ "{r0}"(numerator), "{r1}"(denominator) :/* clobbers */ "r3" :/* options */ ); } (div_out, mod_out) }
} And next, since most of the time we really do want just the div or modulus without having to explicitly throw out the other half, we also define intermediary functions to unpack the correct values. pub fn div(numerator: i32, denominator: i32) -> i32 { div_modulus(numerator, denominator).0
} pub fn modulus(numerator: i32, denominator: i32) -> i32 { div_modulus(numerator, denominator).1
} We can generally trust the compiler to inline single line functions correctly even without an #[inline] directive when it's not going cross-crate or when LTO is on. I'd point you to some exact output from the Compiler Explorer, but at the time of writing their nightly compiler is broken, and you can only use inline asm with a nightly compiler. Unfortunate. Hopefully they'll fix it soon and I can come back to this section with some links.

