Of course, now that we can do divmod if we need to, let's get back to random numbers in ranges that aren't exact powers of two. yada yada yada, if you just use x % n to place x into the range 0..n then you'll turn an unbiased value into a biased value (or you'll turn a biased value into an arbitrarily more biased value). You should never do this, etc etc. So what's a good way to get unbiased outputs? We're going to be adapting some CPP code from that that I first hinted at way up above. It's specifically all about the various ways you can go about getting unbiased random results for various bounds. There's actually many different methods offered, and for specific situations there's sometimes different winners for speed. The best overall performer looks like this: uint32_t bounded_rand(rng_t& rng, uint32_t range) { uint32_t x = rng(); uint64_t m = uint64_t(x) * uint64_t(range); uint32_t l = uint32_t(m); if (l < range) { uint32_t t = -range; if (t >= range) { t -= range; if (t >= range) t %= range; } while (l < t) { x = rng(); m = uint64_t(x) * uint64_t(range); l = uint32_t(m); } } return m >> 32;
} And, wow, I sure don't know what a lot of that means (well, I do, but let's pretend I don't for dramatic effect, don't tell anyone). Let's try to pick it apart some. First, all the uint32_t and uint64_t are C nonsense names for what we just call u32 and u64 . You probably guessed that on your own. Next, rng_t& rng is more properly written as rng: &rng_t . Though, here there's a catch: as you can see we're calling rng within the function, so in rust we'd need to declare it as rng: &mut rng_t , because C++ doesn't track mutability the same as we do (barbaric, I know). Finally, what's rng_t actually defined as? Well, I sure don't know, but in our context it's taking nothing and then spitting out a u32 . We'll also presume that it's a different u32 each time (not a huge leap in this context). To us rust programmers that means we'd want something like impl FnMut() -> u32 . pub fn bounded_rand(rng: &mut impl FnMut() -> u32, range: u32) -> u32 { let mut x: u32 = rng(); let mut m: u64 = x as u64 * range as u64; let mut l: u32 = m as u32; if l < range { let mut t: u32 = range.wrapping_neg(); if t >= range { t -= range; if t >= range { t = modulus(t, range); } } while l < t { x = rng(); m = x as u64 * range as u64; l = m as u32; } } (m >> 32) as u32
} So, now we can read it. Can we compile it? No, actually. Turns out we can't. Remember how our modulus function is (i32, i32) -> i32 ? Here we're doing (u32, u32) -> u32 . You can't just cast, modulus, and cast back. You'll get totally wrong results most of the time because of sign-bit stuff. Since it's fairly probable that range fits in a positive i32 , its negation must necessarily be a negative value, which triggers exactly the bad situation where casting around gives us the wrong results. Well, that's not the worst thing in the world either, since we also didn't really wanna be doing those 64-bit multiplies. Let's try again with everything scaled down one stage: pub fn bounded_rand16(rng: &mut impl FnMut() -> u16, range: u16) -> u16 { let mut x: u16 = rng(); let mut m: u32 = x as u32 * range as u32; let mut l: u16 = m as u16; if l < range { let mut t: u16 = range.wrapping_neg(); if t >= range { t -= range; if t >= range { t = modulus(t as i32, range as i32) as u16; } } while l < t { x = rng(); m = x as u32 * range as u32; l = m as u16; } } (m >> 16) as u16
} Okay, so the code compiles, and it plays nicely what the known limits of the various number types involved. We know that if we cast a u16 up into i32 it's assured to fit properly and also be positive, and the output is assured to be smaller than the input so it'll fit when we cast it back down to u16 . What's even happening though? Well, this is a variation on Lemire's method . One of the biggest attempts at a speedup here is that when you have a %= b; You can translate that into if a >= b { a -= b; if a >= b { a %= b; }
} Now... if we're being real with ourselves, let's just think about this for a moment. How often will this help us? I genuinely don't know. But I do know how to find out: we write a program to just enumerate all possible cases and run the code. You can't always do this, but there's not many possible u16 values. The output is this: skip_all:32767
sub_worked:10923
had_to_modulus:21846
Some skips:
32769
32770
32771
32772
32773
Some subs:
21846
21847
21848
21849
21850
Some mods:
0
1
2
3
4 So, about half the time, we're able to skip all our work, and about a sixth of the time we're able to solve it with just the subtract, with the other third of the time we have to do the mod. However, what I personally care about the most is smaller ranges, and we can see that we'll have to do the mod if our target range size is in 0..21846 , and just the subtract if our target range size is in 21846..32769 , and we can only skip all work if our range size is 32769 and above. So that's not cool. But what is cool is that we're doing the modulus only once, and the rest of the time we've just got the cheap operations. Sounds like we can maybe try to cache that work and reuse a range of some particular size. We can also get that going pretty easily. #[derive(Debug, Clone, Copy, PartialEq, Eq)]
pub struct RandRangeU16 { range: u16, threshold: u16,
} impl RandRangeU16 { pub fn new(mut range: u16) -> Self { let mut threshold = range.wrapping_neg(); if threshold >= range { threshold -= range; if threshold >= range { threshold = modulus(threshold as i32, range as i32) as u16; } } RandRangeU16 { range, threshold } } pub fn roll_random(&self, rng: &mut impl FnMut() -> u16) -> u16 { let mut x: u16 = rng(); let mut m: u32 = x as u32 * self.range as u32; let mut l: u16 = m as u16; if l < self.range { while l < self.threshold { x = rng(); m = x as u32 * self.range as u32; l = m as u16; } } (m >> 16) as u16 }
} What if you really want to use ranges bigger than u16 ? Well, that's possible, but we'd want a whole new technique. Preferably one that didn't do divmod at all, to avoid any nastiness with sign bit nonsense. Thankfully there is one such method listed in the blog post, "Bitmask with Rejection (Unbiased)" uint32_t bounded_rand(rng_t& rng, uint32_t range) { uint32_t mask = ~uint32_t(0); --range; mask >>= __builtin_clz(range|1); uint32_t x; do { x = rng() & mask; } while (x > range); return x;
} And in Rust pub fn bounded_rand32(rng: &mut impl FnMut() -> u32, mut range: u32) -> u32 { let mut mask: u32 = !0; range -= 1; mask >>= (range | 1).leading_zeros(); let mut x = rng() & mask; while x > range { x = rng() & mask; } x
} Wow, that's so much less code. What the heck? Less code is supposed to be the faster version, why is this rated slower? Basically, because of how the math works out on how often you have to run the PRNG again and stuff, Lemire's method usually better with smaller ranges and the masking method usually works better with larger ranges. If your target range fits in a u8 , probably use Lemire's. If it's bigger than u8 , or if you need to do it just once and can't benefit from the cached modulus, you might want to start moving toward the masking version at some point in there. Obviously if your target range is more than a u16 then you have to use the masking method. The fact that they're each oriented towards different size generator outputs only makes things more complicated. Life just be that way, I guess.

